import React from "react";
import { Segment, Dimmer, Loader } from "semantic-ui-react";

const Redirection: React.FC = () => {
  return (
    <Segment style={{ height: "100vh", width: "100vw" }}>
      <Dimmer active>
        <Loader>Logging you in..</Loader>
      </Dimmer>
    </Segment>
  );
};

export default Redirection;
